import React from 'react';
import './App.css';
import Footer from "./components/footer.tsx";
import Header from "./components/header.tsx";
import Home from "./";

function App() {

  return (
    <div className="App">
      <Header />
      <Home />
      <Footer />
      {/* <Login /> */}
      </div>
  );
}

export default App;
